import '../button/Button.scss';
import './Footer.scss'
import Button from '../../components/button/Button';
import ButtonComponent from '../../components/button-component/ButtonComponent';
import React from 'react';
import { createTheme } from '@material-ui/core/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#2E455A',
    },
    secondary: {
      main: '#FFFFFF',
    },
  },
});

function Footer({classFooter, nameBtn, buttonNext, buttonbackPage, showButtonWhite, showButtonBlue}){

    return (
      <footer className={classFooter}>
        <div className="container-footer1">
        <p>Powered by</p>
         <Button classBtn ="buttonLogo" nameBtn="Key Peoples Insights"/>
        </div>
        <div className="container-footer2">
          <div style={showButtonWhite}>
            <ButtonComponent theme={theme} position="secondary" nameBtn={nameBtn} buttonClick={buttonNext}/>
          </div>
          <div style={showButtonBlue}>
            <ButtonComponent theme={theme} position="primary" nameBtn={nameBtn} buttonClick={buttonbackPage}/>
          </div>          
        </div>
      </footer>
    );
  };
  export default Footer;
